package Datatypes.java;

public class Bitwiseshiftoperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b =2;
		int res =a>>b;
		System.out.println(res);//12
		// 
		int i =5;
		int j=1;
		int c= i<<j;
		System.out.println(c);//160
		 
		//
		int f=10;
		int d=1;
		int k= f>>>d;
		System.out.println(k);//5
	}

}
